  \"Towards Better Modeling and Simulation of Nonlinear Aeroelasticity On and Beyond
  Transonic Regimes Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-05-06T21:09:21.442143\",\n\t\"name\": \"towards-better-modeling-and-simulation-of-nonlinear-aeroelasticity-on-and-beyond-transonic\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The need to accurately predict aeroelastic
  phenomenon for a wide range of Mach numbers is a critical step in the design process
  of any aerospace vehicle. Complex aerodynamic phenomenon such as vortex shedding,
  shock-turbulence interaction, separation, etc. dominate at transonic and supersonic
  Mach numbers and hence the need to address these phenomena is of utmost importance
  in the modeling process. Research is proposed for the development and implementation
  of state of the art, large-eddy-simulation (LES) based computational models for
  problems in nonlinear aeroelasticity. Highly efficient and accurate subgrid-scale
  (SGS) models will be incorporated into the flow solver and coupled with high fidelity
  structure solvers to predict aeroelastic phenomena such as transonic flutter, limit
  cycle oscillations, etc. The SGS models proposed are based on eddy-viscosity and
  non-eddy-viscosity models and they will both be assessed for accuracy and robustness
  in the context of nonlinear aeroelasticity. The implications of the proposed work
  include using highly accurate turbulence models with efficient finite element models
  of structure to solve problems in nonlinear aeroelasticity. The application of the
  proposed innovations spans the range of flight, from subsonic to supersonic transport
  vehicles. Anticipated results include 1) the implementation of the proposed LES
  methodology into current aeroelastic toolset 2) application of the proposed work
  to large-scale simulation and comparison with experiment and lower fidelity RANS-based
  aeroelastic simulations and 3) advancement of the state of knowledge for nonlinear
  problems in aeroelasticity.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
